def add():
    '''
    思路:从输入框给定的第一个字母找起，循环寻找直至找到后一个字母或本字母。
    '''
    global words
    for i in words_filename:
        with open("words\\"+i,"r",encoding="utf-8") as d:
            read = d.read()
            if not word_entry.get() in read.split("\n"):
                letter = ord(word_entry.get()[0])
                f = search(chr(letter)+"[a-z]{4}",read)
                while not f:
                    letter += 1
                    f = search(chr(letter)+"[a-z]{4}",read)
                new_word = read[0:f.span()[0]]+word_entry.get()+"\n"+read[f.span()[1]+1:]
                with open("words\\"+i,"w") as f:
                    f.write(new_word)
            if not word_entry.get() in words:
                words = words.split("\n")
                words.append(word_entry.get())
            del d
    showinfo(translate("提示"),translate("添加成功！"))

